package fr.canalplus.integration.common.beans.entities;

public class MaterialNumber {

	private String numeroSerie;
	private String refArticle;
	private String libCodeProprietaire;
	private String typeMateriel;

	public MaterialNumber() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getNumeroSerie() {
		return numeroSerie;
	}

	public void setNumeroSerie(String numeroSerie) {
		this.numeroSerie = numeroSerie;
	}

	public String getRefArticle() {
		return refArticle;
	}

	public void setRefArticle(String refArticle) {
		this.refArticle = refArticle;
	}

	public String getLibCodeProprietaire() {
		return libCodeProprietaire;
	}

	public void setLibCodeProprietaire(String libCodeProprietaire) {
		this.libCodeProprietaire = libCodeProprietaire;
	}

	public String getTypeMateriel() {
		return typeMateriel;
	}

	public void setTypeMateriel(String typeMateriel) {
		this.typeMateriel = typeMateriel;
	}

}
